    import './Model.css';
    import Car from './car/Car';

    

    function Model({name, brand, cars}) {

      const carElements = cars.map(model => <Car name={cars.name} year={cars.year} power={cars.power} weight={cars.weight}/>);

        return (
            <article className="model-content">
              
                <h3><span className="brand">{brand}</span>&nbsp;<span className="model">{name}</span></h3>
                <a className="image-link">
                  <img className="image" src="http://www.regcheck.org.uk/image.aspx/@Zm9yZCBtdXN0YW5n" />
                </a>
              
                
              
              </article>
        );
    }

    export default Model;
